def hankelTransform(f, k, order=0):
    """
    0th/1st-order Hankel-transform of f.

    F_n(k) = int_0^oo r f(r) J_n(kr) dr,     n=0,1

    Note that Anderson's implementation includes the r factor in input function
    (i.e. g(r) = r * f(r)), but this is *not* the case for this procedure.
    """

    # Get [cached] points and weights
    if order in hankelTransform.__dict__:
        p, w = hankelTransform.__dict__[order]
    else:
        p = hankel_points()
        w = hankel_weights(order=order)
        hankelTransform.__dict__[order] = p, w

    # Anderson's implementation requires function g to include the r factor
    def g(r): return r*f(r)

    # N.dot(w, g(p/k[:,N.newaxis]).T) / k is only valid for 1D arrays
    return N.dot(w, g(p/k[..., N.newaxis]).swapaxes(-1, -2)) / k


if __name__ == '__main__':

    import matplotlib.pyplot as P
    try:
        import hankel as H
        hasH = True
        print("hankel library v%s" % (H.__version__))
    except ImportError:
        print("Cannot import hankel library.")
        hasH = False

    print("Hankel transformation: %d points" % len(hankel_points()))

    # Same test functions as in Borchers' MATLAB implementation, but does not
    # include the extra r factor.

    # Test functions and analytic transforms (see
    # http://en.wikipedia.org/wiki/Hankel_transform)
    def f1(r): return N.exp(-r**2)
    def F1(k): return N.exp(-k**2 / 4) / 2       # 0th-order

    def f2(r): return r * N.exp(-r**2)
    def F2(k): return k * N.exp(-k**2 / 4) / 4   # 1st-order

    def f3(r): return N.exp(-r) / r
    def F3(k): return (1 + k**2)**(-0.5)            # 0th-order

    def f4(r): return N.exp(-r) / r
    def F4(k): return (1 - (1 + k**2)**(-0.5)) / k  # 1st-order

    def f5(r): return N.exp(-r)
    def F5(k): return k / (1 + k**2)**(1.5)         # 1st-order

    fs = [f1, f2, f3, f4, f5]               # Test functions
    orders = [0, 1, 0, 1, 1]                # Orders
    Fs = [F1, F2, F3, F4, F5]               # Analytic transforms

    k = N.concatenate(([0.0001, 0.001, 0.01, 0.02, 0.03, 0.04],
                       N.linspace(0.05, 5, 100))).astype('d')  # Original
    k = N.logspace(N.log10(5e-2), N.log10(5), 1000)

    fig = P.figure()
    ax1 = fig.add_subplot(2, 1, 1,
                          title="0th/1st-order Hankel tranforms",
                          ylabel='Hankel transform')
    ax2 = fig.add_subplot(2, 1, 2,
                          xlabel='k',
                          ylabel='Relative error', yscale='log')

    for i, (f, F, order) in enumerate(zip(fs, Fs, orders), start=1):
        h = hankelTransform(f, k, order=order)   # Numeric
        t = F(k)                                 # Analytic

        l, = ax1.plot(k, t, label='H%d(f%d)' % (order, i))    # Analytic
        col = l.get_color()
        ax2.plot(k, N.abs(h-t)/N.abs(t), c=col, ls='-')       # Relative error

        if hasH:                # Test against hankel library
            h, Fk, n = H.get_h(f, order, K=k)  # Estimate best h
            print("Test #%d: order=%d, h=%f, N=%d" % (i, order, h, n))
            ax1.plot(k, Fk, c=col, ls='--')
            ax2.plot(k, N.abs(Fk - t)/N.abs(t), c=col, ls='--')

    ax1.legend(loc='best', prop=dict(size='small'))

    fig.tight_layout()

    P.show()
